class AntAlgorithm:
    def __init__(self, alpha: float = 1, beta: float = 1, rbo: float = 0.5, elite: int = 0, start_index: int = 0,
                 pheromone: float = 1):
        """
        Инициализация
        :param alpha: параметр вероятности
        :param beta: параметр вероятности
        :param rbo: испарение феромона
        :param elite: число элитных мурвьев
        :param start_index: индекс для начала пути
        :param pheromone: общее кол-во ферамона на всех путях
        """

        self.alpha = alpha
        self.beta = beta
        self.rbo = rbo
        self.start_index = start_index
        self.pheromone = pheromone
        self.elite = elite

        self.cities = None
        self.ages = None
        self.ants = None
        self.ph = None
        self.best_dist = None
        self.best_route = None
        self.ant_best_dist = None
        self.ant_average_dist = None

    def run(self, matrix: np.array, ages: int = -1, ants: int = -1, ph: float = -1):
        """
        Функция для запуска алгоритма
        :param matrix: матрица смежности
        :param ages: кол-во поколений (итераций)
        :param ants: кол-во муравьев
        :param ph: начальный ферамон в матрице ферамонов
        :return:
        """
        self.cities = len(matrix)

        if ages > 0:
            self.ages = int(ages)
        else:
            self.ages = self.cities // 2

        print(f'ages = {self.ages}')
        if ants > 0:
            self.ants = int(ants)
        else:
            self.ants = self.cities
        print(f'ants = {self.ants}')
        if ph > 0:
            self.ph = ph
        else:
            self.ph = self.pheromone / self.cities

        reverse_matrix = 1 / np.array(matrix)
        np.fill_diagonal(reverse_matrix, 0)

        pheromone_matrix = np.ones((self.cities, self.cities)) * self.ph

        self.best_dist = float("inf")

        ant_route = np.zeros((self.ants, self.cities))
        ant_dist = np.zeros(self.ants)

        self.ant_best_dist = np.zeros(self.ages)
        self.ant_average_dist = np.zeros(self.ages)

        def count_way(route):
            """
            Функция для подсчета растояния пути
            :param route: путь
            :return: растояние пути
            """
            sum_way = 0
            for r in range(len(route)):
                c_from = int(route[r - 1])
                c_to = int(route[r])
                sum_way += matrix[c_from][c_to]
            return sum_way

        for age in range(self.ages):
            start_time = time.time()
            ant_route.fill(0)
            ant_dist.fill(0)

            for k in range(self.ants):
                if k == 0:
                    ant_route[k, 0] = self.start_index
                else:
                    ant_route[k, 0] = ant_route[k - 1][-1]

                for s in range(1, self.cities):

                    start_city = int(ant_route[k, s - 1])
                    probability = (pheromone_matrix[start_city] ** self.alpha) * (
                                   reverse_matrix[start_city] ** self.beta)

                    for i in range(s):
                        probability[int(ant_route[k, i])] = 0

                    probability = probability / sum(probability)

                    is_not_chosen = True
                    while is_not_chosen:
                        rand = np.random.rand()
                        for p, to in zip(probability, list(range(self.cities))):
                            if p > rand:
                                ant_route[k, s] = to
                                is_not_chosen = False
                                break
                print(f"Муравей {k} прошел все города")

                ant_dist[k] = count_way(ant_route[k])
                # if np.sum(ant_dist[k]) == 2678344.0:
                #     sum_route = 0
                #     rute = ant_route[k]
                #     for s in range(self.cities):
                #         city_from = int(ant_route[k, s - 1])
                #         city_to = int(ant_route[k, s])
                #         incr = matrix[city_from][city_to]
                #         sum_route += incr

                if ant_dist[k] <= self.best_dist:
                    self.best_dist = ant_dist[k]
                    self.best_route = copy.deepcopy(ant_route[k])

            print(f'Все муравьи прошли поколение {age}')
            # pheromone_matrix *= (1 - self.rbo)

            for k in range(self.ants):
                for s in range(self.cities):
                    city_to = int(ant_route[k, s])
                    city_from = int(ant_route[k, s - 1])
                    pheromone_matrix[city_to][city_from] += self.pheromone

                    pheromone_matrix[city_from][city_to] += self.pheromone
            pheromone_matrix *= (1 - self.rbo)
            print(f"Конец добавления феромонов поколения {age}")
            if self.elite > 0:
                for elite in range(self.elite):
                    for s in range(self.cities):
                        city_to = int(self.best_route[s])
                        city_from = int(self.best_route[s - 1])
                        pheromone_matrix[city_to][city_from] += self.pheromone

            self.ant_best_dist[age] = self.best_dist
            self.ant_average_dist[age] = np.average(ant_dist)

            print(f"Поколение {age} завершено")
            print("time of execution: %s seconds" % abs(time.time() - start_time))

    def get_best_route(self) -> list:
        return self.best_route

    def get_best_dist(self):
        return self.best_dist


def distance(x1: int, y1: int, x2: int, y2: int) -> int:
    """
    Функция для подсчета евклидового растояний в 2D
    :param x1: координаты 1-ой точки по X
    :param y1: координаты 1-ой точки по Y
    :param x2: координаты 2-ой точки по X
    :param y2: координаты 2-ой точки по Y
    :return:
    """
    return round(np.sqrt(((x1 - x2) ** 2) + ((y1 - y2) ** 2)))


